1. t141 ⇒ {NT24}  
2. t176 ⇒ {NT35}  
3. t40  ⇒ {NT36}  
4. t105 ⇒ {NT36, NT52}  
5. t210 ⇒ {NT35, NT2}  
6. t154 ⇒ {NT36, NT25}  
