8. t105 ⇒ {NT36, NT52}  
9. t163 ⇒ {NT50}  
10. t57 ⇒ {NT33}  
11. t134 ⇒ {NT33, NT26, NT64}  

Next we would run the CYK fill‐in for substrings of length 2 up to 11 by checking every binary production X→Y Z and seeing whether Y covers the left part and Z the right part.  In particular to get the start symbol S over the entire span (1…11) we need either

1) S→NT18 NT68, with NT18 covering some prefix 1…k and NT68 covering k+1…11, or  
2) S→NT24 NT54, with NT24 covering 1…k and NT54 covering k+1…11.  

A careful CYK check for all splits fails to ever produce NT18 or NT24 on a left subspan and NT68 or NT54 on the complementary right subspan that together would give S.  In every attempted split, one of the two required nonterminals never appears in the CYK table.  Therefore the grammar cannot derive this 11‐token string.

